#!/usr/bin/perl
use strict;
use warnings;
no warnings 'recursion';
use feature 'say';
use Benchmark;
#Collatz conjecture
#https://perlweeklychallenge.org/blog/perl-weekly-challenge-054/

my @out;
my $r;
my %mem;
my $cnt = 0;
my $ctr = 20;
sub gen_seq {
    my ($n) = @_;
    #The if statement below improved execution time from 75 secs to 10 secs
    if ($mem{$n}) {
        $cnt    += $mem{$n} =~y/ //;
        $r      .= $mem{$n};
        return
    }
    $r .= "$n ";
    return if ($n == 1);

    gen_seq( $n & 1 ? 3*$n+1 : $n/2 );
}

my $t0 = Benchmark->new;
for my $n (2..1e6) {
    $r = "";
    gen_seq($n);
    $mem{$n} = $r;
    push @{$out[$r=~y/ //]}, "$r";
}

my $t1 = Benchmark->new;
my $td = timediff($t1, $t0);


OUTER: while (@out) {
    my $arr = pop @out;
    for my $seq (@{$arr}) {
        printf ("%03d: %s\n\n",$seq=~y/ //, $seq);
        last OUTER if !--$ctr;
    }
}

say "Total Saved Iterations: $cnt";
say "The code took:",timestr($td),"\n";

